import React from 'react'
import { ReactComponent as Chatsvg } from '../../assets/chat.svg'

class Chat extends React.Component {
  constructor(props) {
    super(props)

    this.state = {
      hidden: true
    }

  }

  toggleHidden = () => {
    this.setState({ hidden: !this.state.hidden})
  }

  render() {
    return (
      <div className='chat-screen' onClick={() => this.props.toggle()}>
        go back
      </div>
    )
  }
}

export default Chat
